    [],nt"revision_timestamp": "2016-09-27T18:18:24.629177",nt"name": "usgs-alaska-ifsar-and-dem-acquisition-plan-objectives-for-fy15-fy17-from-the-national-map-3d-e",nt"isopen":
    true,nt"url": null,nt"notes": "U.S. Geological Survey, Department of the
    Interior - The annual Alaska IfSAR and DEM acquisition plan is part of the 3DEP
    initiative to collect high-quality elevation data in the form of interferometric
    synthetic aperture radar (IfSAR) and light detection and ranging (lidar) data over
    Alaska. This acquisition plan addresses concerns raised in GAO Report 13-94 regarding
    geospatial coordination, and supports FGDC data coordination initiatives led by
    the Department of Interior's Geospatial Information Officer. Mapping a State the
    size and complexity of Alaska through a partnered effort such as the Alaska Mapping
    Initiative requires dedicated collaboration and coordination across multiple levels
    of government. State efforts for the collection of IfSAR data are being coordinated
    through Alaska's Statewide Digital Mapping Initiative (SDMI), a cooperative program
    implemented across six State of Alaska departments and the University of Alaska.
    Federal efforts are coordinated through the Alaska Mapping Executive Committee (AMEC),
    chaired by the Department of the Interior with membership from 15 Federal agencies
    and representatives from the State of Alaska (Charter can be found at http://nationalmap.gov/alaska/amec_charter.html
    ). The FY17 acquisition plan currently anticipates collecting 16,000 sq. mi. or
    more depending on partnerships and other contributions to the plan. Interested parties
    who wish to become a funding partner with the USGS in FY17 or in future years should
    contact Becci Anderson, USGS Geospatial Liaison, rdanderson@usgs.gov. Products will
    include: 5M DEM/DSM, Orthorectified IfSAR Intensity Image (ORII), and other standard
    derived NED datasets. To find out more about the Alaska IfSAR Acquisition for 3DEP
    initiative go to http://nationalmap.gov/alaska/ami_partners.html",nt"license_title":
